test('dataUtil.removeLongPropertyValues - Test 9', () => {
    let placeholder = dataUtil.getDefaultRemovedPlaceholder();
    let object = {a: 'asdf', b: '123', c: [1, 'a', '1234', ['11234', '1', 3], {a: 'abc', b: 'abcd'}]};
    let originalCopy = JSON.parse(JSON.stringify(object));
    let maxLength = 3;
    let expectedObject = {a: placeholder, b: '123', c: [1, 'a', placeholder, [placeholder, '1', 3], {a: 'abc', b: placeholder}]};
    expect(dataUtil.removeLongPropertyValues(object, maxLength)).toEqual(expectedObject);
    expect(object).toEqual(originalCopy); //original should not be modified
});

test('dataUtil.removeLongPropertyValues - Test 10', () => {
    let placeholder = dataUtil.getDefaultRemovedPlaceholder();
    let object = {
        a: 'asdf',
        b: '123',
        c: {
            array: [1, 'a', '1234', ['11234', '1', 3], {a: 'abc', b: 'abcd'}],
            x: '12345235235',
            y: 1,
            z: null,
            a: undefined,
            b: {},
            c: []
        },
        d: ['asdfa', 1, 2, '', '123']
    };
    let maxLength = 3;
    let expectedObject = {
        a: placeholder,
        b: '123',
        c: {
            array: [1, 'a', placeholder, [placeholder, '1', 3], {a: 'abc', b: placeholder}],
            x: placeholder,
            y: 1,
            z: null,
            a: undefined,
            b: {},
            c: []
        },
        d: [placeholder, 1, 2, '', '123']
    };
    expect(dataUtil.removeLongPropertyValues(object, maxLength)).toEqual(expectedObject);
});

